import './InnerBanner.scss'
export default function InnerBanner({image,title}) {
  return (
    console.log(image),
    <div className='wuudly__innerBanner' style={{backgroundImage:URL('image')}}>
        <h1>{title}</h1>
    </div>
  )
}
